import React from 'react';
const List = (props) =>{
    const { information } = props;
    if (!information || information.lenght === 0) return <p> No information available, sorry</p>;
    return(
        <ul>
            <h2 className = 'list-head'> Available Information:</h2>
            {information.map((information) => {
                return(
                    <li key={information.id} className ='list'>
                        <span className='First Name'>{information.firstName}</span>
                        <span className='Account Number'>{information.accountNumber}</span>
                    </li>
                    );
            })}
        </ul>
    );
};

export default List;
